div.inline-block.nyancat-scroll {
  background-color: #272a30;
  height: 23px;
  padding: 3px 0 3px 0;
}
.nyancat-scroll-trail {
  position: relative;
  display: inline-block;
  width: 9px;
  background-image: url(data:image/gif;base64,);
  background-repeat: repeat-x;
  height: 17px;
}
.nyancat-scroll-arse {
  position: absolute;
  top: 0;
  right: 0;
  width: 11px;
  height: 17px;
  background-image: url(data:image/png;base64,);
  background-repeat: no-repeat;
}
.nyancat-scroll-head {
  position: relative;
  display: inline-block;
  width: 18px;
  height: 17px;
  background-image: url(data:image/png;base64,);
  background-repeat: no-repeat;
}
